// PrivateRoute.tsx

import React from 'react';
import { Route, Navigate } from 'react-router-dom';

interface PrivateRouteProps {
  element: React.ReactNode;
  path: string;
  // Puedes agregar otras props según sea necesario
}

const PrivateRoute: React.FC<PrivateRouteProps> = ({ element: Element, ...rest }) => {
  // Lógica para verificar autenticación o permisos
  const isAuthenticated = true; // Aquí debes implementar tu lógica real de autenticación

  return (
    <Route
      {...rest}
      element={isAuthenticated ? <Element /> : <Navigate to="/login" />} // Usamos Navigate para redirigir
    />
  );
};

export default PrivateRoute;
